    in the sequence.
    >>> rolling_max([1, 2, 3, 2, 3, 4, 2])
    [1, 2, 3, 3, 3, 4, 4]
    """
    max = 0
    for i in range(len(numbers)):
        if numbers[i] > max:
            max = numbers[i]
    return [max] + rolling_max(numbers[:i] + numbers[i + 1:])

